import { createGlobalStyle } from "styled-components";
import Header from "./Header";

const GlobalStyles = createGlobalStyle`
  html {
    --red: #ff0000;
    --black: #393939;
    --gray: #3A3A3A;
    --lightGray: #e1e1e1;
    --offWhite: #ededed;
    --maxWidth: 1000px;
    --bs: 0px 12px 24px 0 rgba(0,0,0,0.9);
  }
`;

const Page = ({ children }) => (
  <div>
    <GlobalStyles>
      <Header />
      <h2>I am page component</h2>
      {children}
    </GlobalStyles>
  </div>
);

export default Page;
